import React from "react";
import { BrowserRouter as Link } from "react-router-dom";

class Button extends React.Component {
  render() {
    return (
      <div>
        <Link to="/">
          <button>{this.props.text}</button>
        </Link>
      </div>
    );
  }
}

export default Button;
